      <div className=" w-1/3 bg-white h-1/3  grid grid-cols-2 gap-4 ">
        <div className="border-2 w-full h-full flex justify-center items-center rounded-lg border-green-500">
         <img src="/money.jfif"></img>
         <dvi>Money book</dvi>
